from zhipuai import ZhipuAI

client = ZhipuAI(api_key="")

response = client.chat.completions.create(
    model="cogvlm_28b",  # 填写需要调用的模型名称
    messages=[
        {
            "role": "user",
            "content": [
                {
                    "type": "text",
                    "text": "这是什么"
                },
                {
                    "type": "image_url",
                    "image_url": {
                        "url": ""
                    }
                }
            ]
        }
    ],
    # top_p=0.7,
    # temperature=0.9,
    stream=True,
)

for chunk in response:
    print(chunk.choices[0].delta.content, end='', sep='')

